Site: My Life In Brazil
Girls: Jasmine  

Last time Tony was at this beach, he had to rock a speedo to get some play. Today, we used the old 305 Rap Status to get some play, and play he did! Tony was showing off his rapping skills, and it was enough to attract a local by the name of Jasmine. To our surprise, she knew a great deal about hip-hop and given the fact, we told her we'd be shooting a music video and she would fit perfect in the mix. So she shook it and took it, and GODDAMN!!!! she was a monster with the dick, Tony had a good time, busted all over her face and she was speechless, 305 style, that's right!!
